import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

function createData(employeeId,allowanceName,allowanceCode,category,date,startTime,endTime,Duration,premium,appliedDate,status) {
  return { employeeId,allowanceName,allowanceCode,category,date,startTime,endTime,Duration,premium,appliedDate,status };
}

const rows = [
  createData('mma0210','oncall','001','night','3/3/23','9:00 am','11:00 PM','14:00','-','12/4/23','Approved')
];

export default function BasicTable() {
  return (
    <div className='tablerow'>
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow >
            <TableCell>Employee ID</TableCell>
            <TableCell align="middle">Allowance Name</TableCell>
            <TableCell align="middle">Allowance Code</TableCell>
            <TableCell align="middle">Category</TableCell>
            <TableCell align="middle">Date</TableCell>
            <TableCell align="middle">Start Time</TableCell>
            <TableCell align="middle">End Time</TableCell>
            <TableCell align="middle">Duration</TableCell>
            <TableCell align="middle">Premium</TableCell>
            <TableCell align="middle">Applied Date</TableCell>
            <TableCell align="middle">Status</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow>
              <TableCell align="middle">{row.employeeId}</TableCell>
              <TableCell align="middle">{row.allowanceName}</TableCell>
              <TableCell align="middle">{row.allowanceCode}</TableCell>
              <TableCell align="middle">{row.category}</TableCell>
              <TableCell align="middle">{row.date}</TableCell>
              <TableCell align="middle">{row.startTime}</TableCell>
              <TableCell align="middle">{row.endTime}</TableCell>
              <TableCell align="middle">{row.Duration}</TableCell>
              <TableCell align="middle">{row.premium}</TableCell>
              <TableCell align="middle">{row.appliedDate}</TableCell>
              <TableCell align="middle">{row.status}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </div>
  );
}
